import React, { useState, useEffect } from 'react';
import "./Inicio.css";
import Menu from "../../Menu";
import Header from '../../Header';
import Calendar from './Calendar';
import "../../Fonts.css";

const Inicio = () => {
  const colorCode = 2;
  const [appointments, setAppointments] = useState([]);
  const crp = 12398472633;

  useEffect(() => {
    fetch(('http://localhost:8080/appointment/' + crp), {
      mode: 'no-cors',
      credentials: 'include',
      method: 'POST'
  })
    .then(response => response.json())
    .then(data => setAppointments(data.object))
    .catch(error => console.error(error));
  }, []);

  return (
    <div className="container">
      <div className="item item1-1" style={{ width: '93%' }}><Menu /></div>
      <div className="item item1-2"><Header/></div>
      <div className="item item2-1"><Calendar colorCode={colorCode} appointments={appointments} /></div>
    </div>
  );
};

export default Inicio;
